import React, { useState, useEffect } from 'react'
import { Container } from 'react-bootstrap'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import FloatingLabel from 'react-bootstrap/FloatingLabel'
import { LinkContainer } from 'react-router-bootstrap'

function NewListings() {

    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [genre, setGenre] = useState([]);
    const [location, setLocation] = useState([]);

    const [priceTextBox, setPriceTextBox] = useState(false);
    const handleClose = () => setPriceTextBox(false);
    const handleShow = () => setPriceTextBox(true);

    useEffect(() => {
        fetch('/apis/book/get_all_genres')
            .then(res => res.json())
            .then(data => {
                setIsLoaded(true);
                setGenre(data);
            },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )

        fetch('/apis/book/get_all_locations')
            .then(res => res.json())
            .then(data => {
                setIsLoaded(true);
                setLocation(data);
            },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )

    }, [])

    function toggleBookPrice() {

    }

    return (
        <div className='mt-4'>
            <Container>
                <div className="d-flex justify-content-center">
                    <h1>New Listings</h1>
                </div>
                <div className="d-flex justify-content-center">
                    <Form>
                        <Form.Group className="mb-3" controlId="formBookName">
                            <Form.Label>Book Title:</Form.Label>
                            <Form.Control type="text" placeholder="Enter book name" />
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formGenre">
                            <Form.Label>Genre:</Form.Label>
                            <Form.Select aria-label="Floating label select condition">
                                {Array.isArray(genre) ?
                                    genre.map(genre => (
                                        <option value={genre.GenreID}>{genre.GenreName}</option>)) : null
                                }
                            </Form.Select>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formCondition">
                            <FloatingLabel controlId="floatingSelectCondition" label="Book Condition">
                                <Form.Select aria-label="Floating label select condition">
                                    <option value="New">New</option>
                                    <option value="Well Used">Well Used</option>
                                </Form.Select>
                            </FloatingLabel>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formPrice">
                            <FloatingLabel controlId="floatingSelectPrice" label="Book Price">
                                <Form.Select aria-label="Floating label select price">
                                    <option value="Free" onSelect={handleClose}>Free</option>
                                    <option value="Priced" onSelect={handleShow}>Priced</option>
                                </Form.Select>
                            </FloatingLabel>
                            <Form.Group className="mb-3" controlId="formBookPrice" priceTextBox={priceTextBox} onHide={handleClose}>
                                <Form.Label>Book Price:</Form.Label>
                                <Form.Control type="text" placeholder="Enter book price" />
                            </Form.Group>
                        </Form.Group>

                        <Form.Group className="mb-3" controlId="formBookDescription">
                            <Form.Label>Book Description:</Form.Label>
                            <Form.Control as="textarea" rows={3} />
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formBookImage">
                            <Form.Label>Book Image: </Form.Label>
                            <Form.Control type="file" />
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formLocation">
                            <FloatingLabel controlId="floatingSelectLocation" label="Location">
                                <Form.Select aria-label="Floating label select location">
                                    {Array.isArray(location) ?
                                        location.map(location => (
                                            <option value={location.LocationID}>{location.LocationName}</option>)) : null
                                    }
                                </Form.Select>
                            </FloatingLabel>
                        </Form.Group>
                        <div className="d-flex justify-content-center mb-3">
                            <LinkContainer to="/MyListings">
                                <Button variant="primary" type="submit">
                                    Upload
                                </Button>
                            </LinkContainer>
                        </div>
                    </Form>
                </div>
            </Container>
        </div >
    )
};

export default NewListings;
